"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[5221],{5221:t=>{t.exports=JSON.parse('{"lessonId":"B1_U114","title":"\u0423\u0440\u043e\u043a 114: \u041f\u0440\u0435\u0434\u043b\u043e\u0433\u0438 (5)","level":"B1","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u041f\u0440\u0435\u0434\u043b\u043e\u0433\u0438","content":[{"text":"<strong>- `para` \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0434\u043b\u044f:</strong><br> - \u0443\u043a\u0430\u0437\u0430\u043d\u0438\u044f \u043f\u0443\u043d\u043a\u0442\u0430 \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u0438\u043b\u0438 \u0446\u0435\u043b\u0438: <i>Ma\xf1ana salimos <strong>para</strong> Londres.</i><br> - \u0443\u043a\u0430\u0437\u0430\u043d\u0438\u044f \u0446\u0435\u043b\u0438 (\u0441 \u0438\u043d\u0444\u0438\u043d\u0438\u0442\u0438\u0432\u043e\u043c): <i>\xbfTiene un cuchillo <strong>para</strong> pelar patatas?</i><br> - \u0443\u043a\u0430\u0437\u0430\u043d\u0438\u044f \u0441\u0440\u043e\u043a\u0430: <i>Necesitamos un apartamento <strong>para</strong> este verano.</i><br> - \u0432\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u044f \u043c\u043d\u0435\u043d\u0438\u044f: <i><strong>Para</strong> Julio, su hermana es perfecta.</i>"},{"text":"<strong>- `por` \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0434\u043b\u044f:</strong><br> - \u0443\u043a\u0430\u0437\u0430\u043d\u0438\u044f \u043f\u0440\u0438\u0447\u0438\u043d\u044b \u0438\u043b\u0438 \u043c\u043e\u0442\u0438\u0432\u0430 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f: <i>Se suspendi\xf3 el partido <strong>por</strong> la lluvia.</i><br> - \u0443\u043a\u0430\u0437\u0430\u043d\u0438\u044f \u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0430, \u0441 \u043f\u043e\u043c\u043e\u0449\u044c\u044e \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0447\u0442\u043e-\u0442\u043e \u0434\u0435\u043b\u0430\u0435\u0442\u0441\u044f: <i>Env\xedale la factura <strong>por</strong> fax.</i><br> - \u0443\u043a\u0430\u0437\u0430\u043d\u0438\u044f \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u043c\u0435\u0441\u0442\u043e\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u044f \u0438\u043b\u0438 \u0442\u0440\u0430\u043d\u0437\u0438\u0442\u0430: <i>Tiene que haber un banco <strong>por</strong> aqu\xed.</i><br> - \u0443\u043a\u0430\u0437\u0430\u043d\u0438\u044f \u0446\u0435\u043d\u044b: <i>Hemos comprado un apartamento <strong>por</strong> cien mil euros.</i>"},{"text":"<strong>- `con` \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0434\u043b\u044f:</strong><br> - \u0443\u043a\u0430\u0437\u0430\u043d\u0438\u044f \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u0438\u043b\u0438 \u0441\u043e\u043f\u0440\u043e\u0432\u043e\u0436\u0434\u0435\u043d\u0438\u044f: <i>Jos\xe9 sale <strong>con</strong> Tina los fines de semana.</i><br> - \u0443\u043a\u0430\u0437\u0430\u043d\u0438\u044f \u0438\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u0430: <i>Pag\xf3 las entradas <strong>con</strong> la tarjeta de cr\xe9dito.</i>"},{"text":"<strong>- `sin` \u0443\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u043d\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0438\u0435 \u0447\u0435\u0433\u043e-\u043b\u0438\u0431\u043e \u0438\u043b\u0438 \u043a\u043e\u0433\u043e-\u043b\u0438\u0431\u043e.</strong><br><i>Me he acostumbrado a beber cerveza <strong>sin</strong> alcohol.</i>"},{"text":"<strong>- `contra` \u0443\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u043d\u0430 \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u043f\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u0435.</strong><br><i>Este domingo juega el Real Madrid <strong>contra</strong> el River Plate.</i>"},{"text":"<strong>- `seg\xfan` \u0443\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u043d\u0430 \u0442\u043e\u0447\u043a\u0443 \u0437\u0440\u0435\u043d\u0438\u044f.</strong><br><i><strong>Seg\xfan</strong> t\xfa, \xbfqui\xe9n tiene raz\xf3n?</i>"}]},{"type":"TheoryBlock","title":"\u041f\u0440\u0438\u043c\u0435\u0447\u0430\u043d\u0438\u0435: \u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u044f 114.1, 114.2, 114.3, 114.4","content":[{"text":"<strong>\u0412\u0441\u0435 \u0443\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u044f \u044d\u0442\u043e\u0433\u043e \u0443\u0440\u043e\u043a\u0430 \u043f\u0440\u043e\u043f\u0443\u0449\u0435\u043d\u044b.</strong>"}]}]}')}}]);